import React from 'react'
import styled from 'styled-components'

export default function Banner() {
  return (
    <div>
        <MainBanner/>
    </div>
  )
}

const MainBanner = styled.image`
    src: './img/Hotel/main-banner.jpg';
    height: 100px;
    width: auto;
`;
